  true,\n\t\"url\": null,\n\t\"notes\": \"This raw data set provides the actual number
  of personnel actions (\"Transfer-Ins\" and \"New Hires\") that have taken place
  within a Fiscal Year.  The scope of this raw data set includes all data elements
  used in the creation of the FedScope Accessions Cube (http://www.fedscope.opm.gov/).
  The following workforce characteristics are available for analysis: Accession, Date,
  Agency, Age (5 year interval), Gender, GS & Equivalent Grade, Length of Service
  (5 year interval), State/Country, Occupation, Occupation Category, Pay Plan & Grade,
  Salary Level ($10,000 interval), Type of Appointment, Work Schedule, Count, Average
  Salary, and Average Length of Service.  Starting in FY 2010, the OPM Enterprise
  Human Resources Integration-Statistical Data Mart (EHRI-SDM) is the source for all
  FedScope data. Data is processed on a quarterly basis (i.e. March, June, September
  and December).\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
